import React from "react"

import Board from "./Board"

export default class Game extends React.Component {
    constructor() {
        super()

        this.state = {
            xIsNext: true,
            stepNumber: 0,
            history: [
                { squares: Array(9).fill(null) },

            ]
        }
    }
    someFunction = () => {
        return 5
    }
    render() {
        const result = this.someFunction()
        return (
            <div>
                <div className="game">
                    <Board value = {result}/>
                </div>
            </div>
        )
    }

}
